import React, { Component } from "react";
import { useHistory } from "react-router-dom";
import { Container, List, Item, Logout } from "./styles";

let history = useHistory();

export default function Navigation({ history }) {
  async function handleSubmit() {
    history.push("/");
  }

  return (
    <Container>
      <List>
        <Item>
          <img
            alt="ADS"
            src="https://ui-avatars.com/api/?font-size=0.33&background=7159c1&color=fff&name=ADS"
          />
        </Item>
      </List>
      <Logout onClick={handleSubmit}>Sair</Logout>
    </Container>
  );
}
